import React from 'react';

const Team = () => {
  const teamMembers = [
    {
      name: 'John Doe',
      position: 'CEO',
      image: '/img/chairman.jpg',
      description: 'John leads the company with over 20 years of experience in the real estate industry.',
    },
    {
      name: 'Jane Smith',
      position: 'COO',
      image: '/img/Operationalmanager.jpg',
      description: 'Jane manages operations and ensures seamless project execution.',
    },
    {
      name: 'Mark Johnson',
      position: 'Head of Sales',
      image: '/img/otherstaffs.jpg',
      description: 'Mark drives our sales team and has a passion for connecting people with properties.',
    },
    {
      name: 'Emily Davis',
      position: 'Chief Architect',
      image: '/img/emily.jpg',
      description: 'Emily designs modern, sustainable, and customer-focused properties.',
    },
  ];

  return (
    <section id="team" className="team-section">
      <h2>Meet Our Team</h2>
      <div className="team-members">
        {teamMembers.map((member, index) => (
          <div key={index} className="team-member">
            <img src={member.image} alt={member.name} className="team-image" />
            <h3>{member.name}</h3>
            <p>{member.position}</p>
            <p>{member.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Team;
